$(document).ready(function(){

	// Make sure main single column is always higher than aside

	var single = $('article.single').height();
	var aside = $('aside.sidebar').height();

	if( single < aside ){
		// $('article.single').height( aside + 1 );
	}


	/* Mobile Breacdcumb Nav */

	$('#breadcrumb-mobile button').click(function(){

		var nav = $('#breadcrumb-mobile .breadcrumb-nav');

		// Open
		if( $(nav).hasClass('hidden') ){
			$(nav).removeClass('hidden');

		// Open
		} else {
			$(nav).addClass('hidden');

		}

	});

	// Add alt tags to parallax
	//$('img.parallax-slider').attr('alt', 'Parallax Slider');


	// Carousel

    var owl = $('.owl-carousel');
    owl.owlCarousel({
        items: 1,
        autoplay: true,
        loop: true,
        nav: true,
        navText: [
            '<i class="fa fa-angle-left"></i>',
            '<i class="fa fa-angle-right"></i>'
        ]
    });

    // Cross Fade Backgrounds

    if( $('.owl-carousel').length > 0 ){
	    var backgroundImages = $.parseJSON(atob($('.owl-carousel').attr('data-background-images')));

	    $(".areas-of-interest figure").bgswitcher({
  			images: backgroundImages,
  			loop: false,
  			start: true,
  			effect: 'fade'
  		});
  	}


	// Invoke CrossFade on Changes to Owl

	owl.on('changed.owl.carousel', function(event) {
		$(".areas-of-interest figure").bgswitcher('select', event.page.index);
	});

});
